(27, 'Software for development', 'A post on how i used different software for software/website development', 'During the process of creating the website I used different software to write and analyse code for my project\r\n\r\nFor me Dreamweaver has some good features like \r\n Live View editing: Dreamweaver offers a convenient feature where you can directly edit text and image attributes and add classes in the Live View. \r\nAlthough, in vs code live editing and preview will have to be done by enabling certain extensions. \r\nDreamweaver can also directly go to a server without using xammp although xampp could still be used if preferred.  \r\n\r\nVS Code although requires software like xampp to run the live server (localhost) of the website. \r\n\r\n\r\n\r\n\r\nFor a paid software I think dreamweaver has more advanced features and for experinced coders who are willing to spend money on it and wanted something from vs code I would recommend but for new coders I would recoomend vs code, Vs code is simple and many extensions can be added if need and other programming languages can be accessed , vs code really isn&rsquo;t overwhelming which I think dreamweaver is , I used vs code as a new coder for my website\r\nAnother psotive feature of vs code is the acsess to git hub where you can push files to your account\r\n\r\n\r\n\r\n \r\n', 0x696d616765732f363737303332333864633336392e706e67, '2024-12-28');

